import * as React from 'react';
import AppLayout from "../components/AppLayout";
import { withRouter } from 'next/router';
import Map from "../components/Map";
import {useSelector} from "react-redux";
import {Card, Image, List} from 'antd';


function ImageDemo() {
    return (
        <Image
            width={300}
            src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
        />
    );
}
const data = [
    {
        title: 'Title 1',
    },
    {
        title: 'Title 2',
    },
    {
        title: 'Title 3',
    },
    {
        title: 'Title 4',
    },
];

const Restaurant = ({ router: { query } }) => {

    let restaurantList = useSelector(state => state.restaurant.restaurantList);

    console.log(restaurantList.filter((e)=> e.id === query.id));

    const {lat, lng} = restaurantList.filter((e)=> e.id === query.id)[0];

    return (
        <AppLayout>
            <div>음식점 상세조회</div>

            <List
                grid={{ gutter: 16, column: 4 }}
                dataSource={data}
                renderItem={item => (
                    <List.Item>
                        <Card title={item.title}><ImageDemo/></Card>
                    </List.Item>
                )}
            />

            <ImageDemo/>
            <ImageDemo/>
            <ImageDemo/>

            <Map lat={lat} lng={lng}></Map>
        </AppLayout>
    );
};

export default withRouter(Restaurant);
